import React, { Component } from "react";
import { addUser } from "../utils/Firestore";
import {
  MDBJumbotron,
  MDBBtn,
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBCardTitle,
  MDBIcon,
  MDBCardBody,
  MDBCardText,
} from "mdbreact";

class Main extends Component {
  state = {};
  render() {
    return (
      <MDBContainer className="mt-5 text-center">
        <MDBRow>
          <MDBCol>
            <MDBJumbotron>
              <MDBCardBody>
                <MDBCardTitle className="h2">
                  Material Design for Bootstrap
                </MDBCardTitle>
                <p className="blue-text my-4 font-weight-bold">
                  Powerful and free Material Design UI KIT
                </p>
                <MDBCardText>
                  Lorem ipsum dolor sit amet, consectetur adipisicing elit. Fuga
                  aliquid dolorem ea distinctio exercitationem delectus qui,
                  quas eum architecto, amet quasi accusantium, fugit consequatur
                  ducimus obcaecati numquam molestias hic itaque accusantium
                  doloremque laudantium, totam rem aperiam.
                </MDBCardText>
                <hr className="my-4" />
                <div className="pt-2">
                  <MDBBtn color="primary" className="waves-effect">
                    Buy now <MDBIcon far icon="gem" />
                  </MDBBtn>
                  <MDBBtn outline color="primary" className="waves-effect">
                    Download <MDBIcon icon="download" />
                  </MDBBtn>
                </div>
              </MDBCardBody>
            </MDBJumbotron>
          </MDBCol>
        </MDBRow>
      </MDBContainer>
    );
  }
}

export default Main;
